ControlPropertyState.AutoRuleBindingString:
If(
	IsBlank(dtpMfgToolST7.SelectedDate), 
	Notify("Please fill in all required fields", NotificationType.Error), 
	UpdateContext({existingRecordST7: LookUp(ECN_Stage7, ES007_ECNReference.Value = SelectedECNNo.ES001_ECNReference)} );
	If( 
        !IsBlank(existingRecordST7),
        Patch( ECN_Stage7, existingRecordST7, 
				{
					ES007_ToolCompletionDate: dtpMfgToolST7.SelectedDate,
					ES007_ToolCompletionRemarks: txtMfgToolRemarksST7.Text,
					ES007_InspectionReportRemarks: txtToolInspRptRemarksST7.Text,
					ES007_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID},					
                    ES007_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
        ),
        Patch( ECN_Stage7, Defaults(ECN_Stage7),
				{
					Title: SelectedECNNo.ES001_ECNReference, 
					ES007_ToolCompletionDate: dtpMfgToolST7.SelectedDate,
					ES007_ToolCompletionRemarks: txtMfgToolRemarksST7.Text,
					ES007_InspectionReportRemarks: txtToolInspRptRemarksST7.Text,
					ES007_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID},
                    ES007_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
			)
    );	
	If(
        !IsEmpty(Errors(ECN_Stage7)), Notify( "An error occurred while saving the record.", NotificationType.Error),
        Patch(
			ECN_Stage1, 
			LookUp(ECN_Stage1,ES001_ECNReference = SelectedECNNo.ES001_ECNReference),
            { ES001_CurrentStage: { Value: "StageClose", Id: LookUp( ECN_StageMaster, Stage_Id = "8").ID }	}
        );
        Notify("Record saved successfully!", NotificationType.Success)
    );    
	Navigate(frmHome)

)
